    "If you like this project and would like to support its development, you are welcome to leave a donation.": {"en": "If you like this project and would like to support its development, you are welcome to leave a donation.", "de": "Wenn dir dieses Projekt gefällt und du dieses Projekt in der Entwicklung unterstützen möchtest, kannst du gerne eine Spende hinterlassen.", "ru": "Если вам нравится этот проект и вы хотите поддержать его развитие, вы можете оставить пожертвование.", "pt": "Se você gosta deste projeto e gostaria de apoiar seu desenvolvimento, fique à vontade para deixar uma doação.", "nl": "Als u dit project leuk vindt en de ontwikkeling ervan wilt ondersteunen, kunt u een donatie achterlaten.", "fr": "Si vous aimez ce projet et souhaitez soutenir son développement, n'hésitez pas à faire un don.", "it": "Se ti piace questo progetto e desideri sostenerne lo sviluppo, puoi lasciare una donazione.", "es": "Si te gusta este proyecto y te gustaría apoyar su desarrollo, puedes dejar una donación.", "pl": "Jeśli podoba Ci się ten projekt i chciałbyś wesprzeć jego rozwój, możesz zostawić darowiznę.", "uk": "Якщо вам подобається цей проект і ви хочете підтримати його розвиток, ви можете залишити пожертву.", "zh-cn": "如果您喜欢这个项目并愿意支持它的发展，欢迎您留下捐款。"},
