    " *** Open InfluxDB Documentation ***": {         "en": "*** Open the InfluxDB documentation ***",          "de": "*** InfluxDB - Dokumentation öffnen ***",          "ru": "*** Открыть документацию InfluxDB ***",            "pt": "   *** Abra a documentação do InfluxDB ***",       "nl": "   *** Open de InfluxDB-documentatie ***",         "fr": "   *** Ouvrez la documentation InfluxDB ***",      "it": "   *** Apri la documentazione di InfluxDB ***",    "es": "   *** Abra la documentación de InfluxDB ***",     "pl": "*** Otwórz dokumentację InfluxDB ***",             "uk": "*** Відкрийте документацію InfluxDB ***",          "zh-cn": "*** 打开 InfluxDB 文档 ***"},
