    "All backup settings can be changed in the adapter configuration of BackItUp.": {"en": "All backup settings can be changed in the adapter configuration of BackItUp.", "de": "Alle Sicherungs Einstellungen können in der Adapterkonfiguration von BackItUp geändert werden.", "ru": "Все настройки резервного копирования можно изменить в конфигурации драйвера BackItUp.", "pt": "Todas as configurações de backup podem ser alteradas na configuração do adaptador de BackItUp.", "nl": "Alle back-upinstellingen kunnen worden gewijzigd in de adapterconfiguratie van BackItUp.", "fr": "Tous les paramètres de sauvegarde peuvent être modifiés dans la configuration de l'adaptateur de BackItUp.", "it": "Tutte le impostazioni di backup possono essere modificate nella configurazione dell'adattatore di BackItUp.", "es": "Todas las configuraciones de respaldo se pueden cambiar en la configuración del adaptador de BackItUp.", "pl": "Wszystkie ustawienia kopii zapasowych można zmienić w konfiguracji adaptera w programie BackItUp.", "uk": "Усі налаштування резервного копіювання можна змінити в конфігурації адаптера BackItUp.", "zh-cn": "所有备份设置都可以在 BackItUp 的适配器配置中更改。"},
